// import { useState } from "react";
import {Routes, Route, useNavigate} from "react-router-dom";
import useEth from "../../contexts/EthContext/useEth";
import NoticeNoArtifact from "./NoticeNoArtifact";
import NoticeWrongNetwork from "./NoticeWrongNetwork";

const content = <>
    <div className="container todo">
    <div class="row">
    <div class="col">
    <form style={{width:"22rem"}}>

<div className="form-outline mb-4">
  <input type="text" id="form5Example1" placeholder="Name" className="form-control" />
</div>

<div className="form-outline mb-4">
  <input type="email" id="form5Example2" placeholder="email" className="form-control" />
  </div>

<button type="button" className="btn btn-primary btn-block mb-4" style={{marginTop:"0px"}}>Submit</button>
</form>
    </div>
    <div class="col-4">
      One of three columns
    </div>
    </div>
    </div>
</>

function Todo(){
    // const navigate = useNavigate();
    const { state: { contract, accounts,artifact } } = useEth();
    return(
        <div>
    {
      !artifact ? <NoticeNoArtifact /> :
        !contract ? <NoticeWrongNetwork /> :
          content
    }
</div>
    )
}

export default Todo;
